import React from 'react';
import axios from 'axios';

const $ = window.$;
const GithubProfile=()=>{
    return(<UserGithub source="https://api.github.com/users/cjwu" />);
}

class UserGithub extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            userName: '',
            githubUrl: '',
            avataUrl: '',
        }
    }
    componentDidMount(){
        $.get(this.props.source, (result) =>{
            console.log(result);
            const data = result;
            if(data){
                this.setState({
                    userName: data.name,
                    githubUrl: data.html_url,
                    avataUrl: data.avatar_url,
                });
            }
        });
    }
    render(){
        return(
            <div>
                <h3>{this.state.userName}</h3>
                <img src={this.state.avataUrl}></img>
                <a href={this.state.githubUrl}>Github Link</a>
            </div>
        );
    }
}

export default GithubProfile;
